{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/hannashuraieva/bellabeat-case-study?scriptVersionId=128791893\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"edba1769","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.017857,"end_time":"2023-05-08T16:40:39.950767","exception":false,"start_time":"2023-05-08T16:40:39.93291","status":"completed"},"tags":[]},"source":["## Case Study: How Can a Wellness Technology Company Play It Smart?"]},{"attachments":{"bc1cac7e-99b4-4bf4-94c2-a7401f645c64.png":{"image/png":""}},"cell_type":"markdown","id":"30ad2d31","metadata":{"papermill":{"duration":0.01151,"end_time":"2023-05-08T16:40:39.976088","exception":false,"start_time":"2023-05-08T16:40:39.964578","status":"completed"},"tags":[]},"source":["![logo-01.png](attachment:bc1cac7e-99b4-4bf4-94c2-a7401f645c64.png)"]},{"cell_type":"markdown","id":"7c9baacb","metadata":{"papermill":{"duration":0.011432,"end_time":"2023-05-08T16:40:40.000589","exception":false,"start_time":"2023-05-08T16:40:39.989157","status":"completed"},"tags":[]},"source":["[Case Study description](#1)   \n","[Business Task](#2)  \n","[1. Ask](#3)  \n","[2. Prepare](#4)  \n","[3. Process](#5)  \n","[4. Analyze](#6)  \n","[5. Share](#7)  \n","[6. Act](#8)  "]},{"cell_type":"markdown","id":"ac64eecc","metadata":{"papermill":{"duration":0.011844,"end_time":"2023-05-08T16:40:40.024199","exception":false,"start_time":"2023-05-08T16:40:40.012355","status":"completed"},"tags":[]},"source":["<a id=\"1\"></a> <br>\n","###  Case Study description"]},{"cell_type":"markdown","id":"25ace871","metadata":{"papermill":{"duration":0.011971,"end_time":"2023-05-08T16:40:40.047959","exception":false,"start_time":"2023-05-08T16:40:40.035988","status":"completed"},"tags":[]},"source":["Bellabeat is a high-tech manufacturer of health-focused products for women. Collecting data on activity, sleep, stress, and reproductive health empowers women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","\n","The purpose of the case study is to analyze smart device fitness data to gain insight into how consumers use their smart devices. The insights will help unlock new growth opportunities for the company.\n"," "]},{"cell_type":"markdown","id":"c3f06fd3","metadata":{"papermill":{"duration":0.011771,"end_time":"2023-05-08T16:40:40.07164","exception":false,"start_time":"2023-05-08T16:40:40.059869","status":"completed"},"tags":[]},"source":["<a id=\"2\"></a> <br>\n","### Business Task"]},{"cell_type":"markdown","id":"0e98efc8","metadata":{"papermill":{"duration":0.011376,"end_time":"2023-05-08T16:40:40.094716","exception":false,"start_time":"2023-05-08T16:40:40.08334","status":"completed"},"tags":[]},"source":["Analyze data from the FitBit fitness tracker to see how users interact with the FitBit app and determine trends to guide marketing strategy for the company. "]},{"cell_type":"markdown","id":"bd5e6be9","metadata":{"papermill":{"duration":0.01179,"end_time":"2023-05-08T16:40:40.117925","exception":false,"start_time":"2023-05-08T16:40:40.106135","status":"completed"},"tags":[]},"source":["<a id=\"3\"></a> <br>\n","### 1. Ask"]},{"cell_type":"markdown","id":"216d48c4","metadata":{"papermill":{"duration":0.011368,"end_time":"2023-05-08T16:40:40.140958","exception":false,"start_time":"2023-05-08T16:40:40.12959","status":"completed"},"tags":[]},"source":["The first step in the data analysis process is to ask the right questions. \n","\n","Who are the main stakeholders in this project and what are their expectations? \n","\n","The following stakeholders are involved in this project: \n","*  Urka Sren: Bellabeats cofounder and Chief Creative Officer\n","*  Sando Mur: Mathematician and Bellabeats cofounder; key member of the Bellabeat executive team\n","*  Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeats marketing strategy.\n","\n","What is the problem you are trying to solve?\n","How can your insights drive business decisions?\n","\n","Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market. Analyzing fitness smart device will help to unlock new growth opportunities for the company.\n","Identified trends will help to draw up high-level recommendations for Bellabeats marketing strategy. \n","\n"," **Key questions:**\n","1. What are some of the trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"6bba3b25","metadata":{"papermill":{"duration":0.011644,"end_time":"2023-05-08T16:40:40.164583","exception":false,"start_time":"2023-05-08T16:40:40.152939","status":"completed"},"tags":[]},"source":["<a id=\"4\"></a> <br>\n","### 2. Prepare\n"]},{"cell_type":"markdown","id":"223438b4","metadata":{"papermill":{"duration":0.011452,"end_time":"2023-05-08T16:40:40.18751","exception":false,"start_time":"2023-05-08T16:40:40.176058","status":"completed"},"tags":[]},"source":["The data used for the project is freely accessible public data from Kaggle generated by responders to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. This Kaggle data set  [FitBit Fitness Tracker Data ](https://www.kaggle.com/datasets/arashnic/fitbit)contains personal fitness tracker from thirty Fitbit users who signed the consent to share the personal tracker data, including daily activity, steps, and heart rate. \n","The data is stored in 18 csv files and organized in wide format.\n","\n","\n","**Data integrity and credibility**\n","\n","This data has limitations. The data was collected in 2016, seven years ago, and may not be actual and accurate. Since then, people's behavior, physical activity, diet, sleeping and health habits may change.  Seven years is also a significant period in scientific and technological progress (today devices can work two or three weeks without recharging, mobility and almost imperceptibility on the hand, a widget for quick synchronization etc.) which could also change usage habits. \n","\n","Number of participants may not be representative of the general female population.\n","\n","It is important to also consider other factors such as age, overall physical activity, diet, family history, and other health conditions when assessing an individual's overall health status. Consulting with a healthcare provider can help provide personalized recommendations for improving health and managing any potential health risks.\n","\n","The integrity and validity of the data are incomplete to provide Bellabeat with reliable insights and business suggestions. Thus, the following analysis can only give the first ideas and directions, which need to be verified by analyzing more extensive and up-to-date data.\n","\n","\n","**ROCCC system to determine that data is Reliable, Original, Comprehensive, Current, and Cited.**\n","\n","\n","* Reliable  LOW  30 responders are a small sample size and does not accurately reflect the entire population of female Fitbit users. \n","* Original  LOW  Amazon Mechanical Turk is Third party data provider.\n","* Comprehensive  LOW  The dataset does not consist of data about gender, age, health conditions and it is not random. The data is biased against women. Low accuracy does not represent the case objectively.\n","* Current  LOW  7-year-old data is not present\n","* Cited  LOW  Data obtained from an unidentified third party (Amazon Mechanical Murk)"]},{"cell_type":"markdown","id":"06a4f83c","metadata":{"papermill":{"duration":0.01139,"end_time":"2023-05-08T16:40:40.210292","exception":false,"start_time":"2023-05-08T16:40:40.198902","status":"completed"},"tags":[]},"source":["<a id=\"5\"></a> <br>\n","###  3. Process"]},{"cell_type":"markdown","id":"b3c934ef","metadata":{"papermill":{"duration":0.011595,"end_time":"2023-05-08T16:40:40.233539","exception":false,"start_time":"2023-05-08T16:40:40.221944","status":"completed"},"tags":[]},"source":["The following analysis will be focused on three datasets: \"dailyActivity_merged\" \"sleepDay_merged\", \"weightLogInfo_merged.csv\" to identify trends in user data.\n","\n","The processes of data cleaning, manipulation, analysis, and visualization will be performed in RStudio. "]},{"cell_type":"code","execution_count":1,"id":"c0ba8c33","metadata":{"execution":{"iopub.execute_input":"2023-05-08T16:40:40.260288Z","iopub.status.busy":"2023-05-08T16:40:40.258456Z","iopub.status.idle":"2023-05-08T16:43:01.958929Z","shell.execute_reply":"2023-05-08T16:43:01.957159Z"},"papermill":{"duration":141.717987,"end_time":"2023-05-08T16:43:01.962919","exception":false,"start_time":"2023-05-08T16:40:40.244932","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","Installing package into /usr/local/lib/R/site-library\n","(as lib is unspecified)\n","\n","also installing the dependency rlang\n","\n","\n","Warning message in install.packages(\"ggplot2\"):\n","installation of package rlang had non-zero exit status\n","Warning message in install.packages(\"ggplot2\"):\n","installation of package ggplot2 had non-zero exit status\n","Installing package into /usr/local/lib/R/si